import React, {Component} from 'react';
import Cart from './Cart.js';
import AddItem from './AddItem.js';
import { BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom'


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <Router>

          <ul>
            <li><Link to={'/'} className="nav-link"> Home </Link></li>
            <li><Link to={'/AddItem'} className="nav-link">View Cart</Link></li>
            <li><Link to={'/Cart'} className="nav-link">Add Item</Link></li>
          </ul>

          <hr />
          <Switch>
              <Route exact path='/' component={App} />
              <Route path='/Cart' component={Cart} />
              <Route path='/AddItem' component={AddItem} />
          </Switch>/>
       <div>
      <div className = "container">
        <div className = "col-xs-12">
          <h1>Welcome to Shop-R-US</h1>
        </div>

      </div>
      </div>
      </Router>
    );
  }

}

export default App;
